INSERT INTO `file_dokumen_textsptdiklat` VALUES (1,'Peraturan Gubernur Nusa Tenggara Barat nomor 85 Tahun 2020 Tentang Pembentukan, Susunan Organisasi,Tugas dan Fungsi serta Tata Kerja Rumah Sakit Mandalika Provinsi Nusa Tenggara Barat tanggal 29 Desember 2020','Melaksanakan tugas dalam rangka mengikuti pelatihan AMLS (Advanced Medical Life Support) yang diselenggarakan oleh RSUD Provinsi NTB bekerja sama dengan NAEMT','2024-09-07 04:21:14.588197','2024-09-09 04:08:09.643897',9),(2,'','Melaksanakan tugas dengan seksama dan penuh tanggung jawab serta melaporkan hasil kegiatan kepada Direktur Rumah Sakit Mandalika Provinsi NTB','2024-09-09 04:10:00.135521','2024-09-09 04:10:00.135557',9),(3,'','Segala bentuk biaya yang dikeluarkan akibat kegiatan ini dibebankan pada DPA Rumah Sakit Mandalika Provinsi NTB','2024-09-09 04:11:09.723627','2024-09-13 05:56:33.615222',9),(4,'','Surat Perintah Tugas ini mulai berlaku pada tanggal 15 Oktober 2024','2024-09-13 05:56:50.663483','2024-09-13 05:56:50.663522',9),(5,'1.	Peraturan Gubernur Nusa Tenggara Barat Nomor 81 Tahun 2020 Tentang Perjalanan Dinas.\r\n2.	Peraturan Gubernur Nusa Tenggara Barat nomor 85 Tahun 2020 Tentang Pembentukan, Susunan Organisasi,Tugas dan Fungsi serta Tata Kerja Rumah Sakit Mandalika Provinsi Nusa Tenggara Barat tanggal 29 Desember 2020','1.	Melaksanakan tugas dalam rangka mengikuti pelatihan Clinical Attacment Fellowship ProgramNorther Care Alliance (NHS)\r\n2.	Melaksanakan tugas dengan seksama dan penuh tanggung jawab serta melaporkan hasil kegiatan kepada Direktur Rumah Sakit Mandalika Provinsi NTB\r\n3.	Surat Perintah Tugas ini mulai berlaku pada tanggal 15 Oktober 2024','2024-10-14 06:27:05.783858','2024-10-14 06:27:44.103385',15);
