INSERT INTO `informasi_informasisdm` VALUES (1,'Pengisian Data SIMADU BERDANSA','<p>Berikut list data yang wajib dan tidak wajib diisi oleh masing-masing SDM Rumah Sakit</p>','','publish',0,1,'informasi/file/sifat_pengisian_simadu.pdf','pengisian-data-simadu-berdansa','2024-09-03 21:20:41.492024','2024-09-05 20:33:05.419225',1,1),(2,'Perpanjangan Pendaftaran CPNS','<p>Berikut Informasi perpanjangan jadwal pendaftaran CPNS di Lingkungan Pemerintah Provinsi NTB, bagi rekan-rekan civitas Hospitalia RS Mandalika yang berminat mendaftar sebagai CPNS harap segera melakukan pendaftaran paling lambat tanggal 10 September 2024.</p>\r\n<p>Untuk lebih jelasnya berikut lampiran surat pemberitahuan perpanjangan pendaftaran CPNS yang dimaksud.</p>','informasi/gambar/cpns.jpg','publish',1,1,'informasi/file/Surat_Plt._Kepala_BKN_-_Penyesuaian_Jadwal_Seleksi_Pengadaan_CPNS_TA_2024_1.pdf','perpanjangan-pendaftaran-cpns','2024-09-06 02:52:20.600832','2024-09-06 20:16:32.322274',323,3);
