INSERT INTO `informasi_nasehatdanhadist` VALUES (1,'Tinggalkanlah apa yang kau ragukan dan kerjakanlah apa yang tidak kau ragukan. Sesungguhnya jujur itu menimbulkan ketenangan dan dusta itu menimbulkan kebimbangan','HR. Tirmidzi','2024-08-18 21:20:32.246580','2024-08-18 21:20:32.246645'),(2,'Sesungguhnya aku diutus untuk menyempurnakan baiknya akhlaq.','HR. Bukhari','2024-08-18 23:28:45.400803','2024-08-18 23:28:45.400860'),(3,'Barangsiapa di antara kamu melihat kemungkaran hendaklah ia mencegah kemungkaran itu dengan tangannya. Jika tidak mampu, hendaklah mencegahnya dengan lisan. Jika tidak mampu juga, hendaklah ia mencegahnya dengan hatinya. Itulah selemah-lemah iman.','HR. Muslim','2024-08-18 23:29:58.358699','2024-08-18 23:29:58.358761'),(4,'Sesungguhnya hanya orang-orang yang bersabarlah yang dicukupkan pahala mereka tanpa batas.','QS. Az Zumar: 10','2024-08-18 23:31:33.522734','2024-08-18 23:31:33.522794'),(5,'Tidaklah Alloh memberikan tambahan kepada seorang hamba yang suka memberi maaf melainkan kemuliaan','HR. Muslim','2024-08-27 22:15:08.676581','2024-08-27 22:15:08.676629'),(6,'Tidak halal bagi seorang mukmin untuk tak bersapaan dengan saudaranya (sesama muslim) lebih dari tiga hari','HR. Muslim','2024-08-27 22:15:56.338189','2024-08-27 22:15:56.338224'),(7,'Sebaik-baik amalan adalah shalat tepat pada waktunya','HR. Tirmidzi','2024-08-27 22:16:22.481706','2024-08-27 22:16:22.481732'),(8,'Sebaik-baik shaff jamaan laki-laki adalah shaff paling depan dan seburuk-buruknya adalah shaff paling belakang. Sebaliknya, sebaik-baik shaff bagi perempuan adalah shaff paling belakang dan seburuk-buruknya adalah shaff paling depan','HR. Muslim','2024-08-27 22:18:12.460828','2024-08-27 22:18:12.460878'),(9,'Sesungguhnya siapa yang tidak meminta kepada Allah ‘Azza wa Jalla, maka Allah ‘Azza wa Jalla akan marah kepadanya','HR Tirmidzi','2024-08-27 23:39:18.740339','2024-08-27 23:39:18.740373'),(10,'Dunia adalah penjara bagi orang beriman dan surga bagi orang kafir.','HR. Muslim','2024-08-27 23:39:59.387274','2024-08-27 23:39:59.387308'),(11,'Ingatlah, hanya dengan mengingat Allah-lah hati menjadi tenteram.','QS. Ar-Ra\'d:28','2024-08-28 04:48:44.554377','2024-08-28 04:48:44.554404'),(12,'Janganlah memalingkan wajahmu dari manusia (karena sombong) dan janganlah berjalan di bumi ini dengan angkuh. Sesungguhnya Allah tidak menyukai setiap orang yang sombong lagi sangat membanggakan diri.','QS Luqman:18','2024-08-28 04:49:41.059682','2024-08-28 04:49:41.059718'),(13,'Kekayaan bukanlah dengan banyaknya harta. Namun kekayaan adalah hati yang selalu merasa cukup.','HR. Bukhari-Muslim','2024-08-28 04:50:25.321778','2024-08-28 04:50:25.321805'),(14,'Naungan bagi seorang mukmin pada hari kiamat adalah sedekahnya.','HR. Ahmad','2024-08-28 05:21:56.558534','2024-08-28 05:21:56.558609'),(15,'Kamu sekali-kali tidak akan memperoleh kebajikan (yang sempurna) sebelum kamu menginfakkan sebagian harta yang kamu cintai. Apa pun yang kamu infakkan, sesungguhnya Allah Maha Mengetahui tentangnya.','QS. Ali Imran:92','2024-08-28 05:24:05.817045','2024-08-28 05:24:05.817081'),(16,'Maka, sesungguhnya beserta kesulitan itu ada kemudahan.','QS. Al Insyiraah:5','2024-08-28 06:44:52.399859','2024-08-28 06:44:52.399911'),(17,'Sesungguhnya beruntung orang yang masuk Islam, mendapat rizki secukupnya dan ia merasa cukup dengan apa yang telah diberikan Allah kepadanya.','HR Muslim','2024-08-28 06:45:41.804231','2024-08-28 06:45:41.804282'),(18,'Allah melapangkan rezeki bagi siapa yang Dia kehendaki dan membatasi (bagi yang Dia kehendaki). Mereka bergembira dengan kehidupan dunia, padahal kehidupan dunia hanyalah kesenangan (yang sedikit) dibanding kehidupan akhirat.','QS. Ar-Ra\'d:26','2024-08-28 06:46:35.031156','2024-08-28 06:46:35.031207'),(19,'Ketahuilah bahwa sabar adalah ibarat kepala dari suatu tubuh. Jika kepala hilang maka keseluruhan tubuh itu akan membusuk. Jika kesabaran hilang, maka seluruh permasalahan akan rusak.','Ali bin Abi Thalib ra.','2024-08-28 08:21:44.188278','2024-08-28 08:21:44.188307'),(20,'Jangan kalian mendahului Ramadhan dengan berpuasa satu atau dua hari sebelumnya, kecuali bagi orang sudah terbiasa berpuasa maka hendaklah ia berpuasa','HR. Muslim','2024-08-28 23:18:13.675006','2024-08-28 23:18:13.675035'),(21,'Janganlah sesorang dari kalian berpuasa pada hari jumat, kecuali jika ia juga berpuasa sehari sebelum atau sesudahnya','HR. Bukhari','2024-08-28 23:19:40.780485','2024-08-28 23:19:40.780533'),(22,'Seandainya orang yang lewat di depan orang shalat itu tahu dosa yang akan dipikulnya, ia pasti akan lebih memilih untuk berdiri selama empat puluh hari dari pada lewat di depan orang shalat','HR. Muslim','2024-09-12 21:14:03.261875','2024-09-12 21:14:03.261924'),(23,'Janganlah kalian shalat menghadap ke kuburan dan jangan pula duduk di atasnya','HR. Muslim','2024-09-12 21:14:44.642603','2024-09-12 21:14:44.642656');
