MUNI\r\nNo Rek: 122-00-1143447-2\r\nBiaya Pelatihan:\r\ns/d 20 September 2024 Rp 2.500.000,-\r\n20 Sept- 17 Okt 2024 Rp 2.800.000,-Pendaftaran ditutup tanggal 17 Okt 2024.\r\n\r\nBukti transfer agar diunggah ke google form dan dikirim ke email pelatihanp3vi@gmail.com\r\natau konfirmasi wa ke nomor admin 082110112801.','diklat/brosur/PELATIHAN_PELAYANAN_VAKSINASI.jpeg','usulan',193,8,187,'2024-10-15 01:46:35.394422','','2024-10-15 01:46:35.394463','','',0,5,2.5),(19,'','diklat/brosur/IMG_5110.jpeg','proses',194,8,158,'2024-10-15 05:10:02.543945','diklat/tor/TOR_-_ADVANCE_PEDIATRIC_RESCUCITATION_COURSE_APRC_Yogyakarta_2024.docx','2024-11-01 06:00:38.797088','','',0,1,NULL),(20,'Rumah Sakit Mandalika Provinsi NTB merupakan rumah sakit umum milik Pemerintah Provinsi Nusa Tenggara Barat yang berlokasi di Kabupaten Lombok Tengah, memberikan pelayanan kesehatan dalam rangka meningkatkan derajat kesehatan masyarakat. Rumah Sakit Mandalika Provinsi Nusa Tenggara Barat mempunyai tugas membantu Gubernur dalam menyelenggarakan urusan pemerintahan di bidang kesehatan secara paripurna sesuai standar pelayanan.\r\nSebagai rumah sakit provinsi yang berada di Lombok Tengah, RS Mandalika Provinsi NTB adalah rumah sakit yang memiliki pelayanan intensif  berupa ruang ICU dan NICU. Ruang ICU adalah unit pelayanan rawat inap dirumah sakit yang memberikan perawatan khusus pada penderita yang memerlukan perawatan yang lebih intensif yang mengalami gangguan kesadaran, gangguan pernafasan, dan mengalami serangan penyakit akut. ICU menyediakan kemampuan, sarana dan prasarana serta peralatan khusus untuk menunjang fungsi-fungsi vital dengan menggunakan keterampilan staf medis, perawat dan staf lain yang  berpengalaman dalam keadaan-keadaan tersebut.\r\nBerdasarkan hal tersebut, kemampuan perawat ICU harus mengimbangi kemampuan dokter jaga (satu bahasa). Karena itu perawat ICU harus mendapat Pelatihan Intensif Dasar agar mampu memberikan pelayanan bermutu dan professional.','diklat/brosur/WhatsApp_Image_2024-09-04_at_07.26.55.jpeg','usulan',195,8,120,'2024-10-17 03:25:31.325424','diklat/tor/TOR_PELATIHAN_KEPERAWATAN_INTENSIVE_DASAR_TY8kIHS.doc','2024-10-17 03:25:31.325473','','',0,1,4.5),(21,'Pelatihan ini merupakan pelatihan wajib yang dimiliki oleh dokter yang bertugas di IGD. Pelatihan ini bertujuan untuk memberikan  pelatihan penanganan kasus- kasus gawat darurat yang berhubungan dengan penyakit jantung.','diklat/brosur/IMG_20241019_060141_890.jpg','usulan',196,8,298,'2024-10-18 23:02:08.645112','diklat/tor/IMG_20241019_060141_890.jpg','2024-10-18 23:02:08.645161','','',0,5,4500),(22,'UNTUK MEMENUHI STANDAR PELAYANAN MINIMAL INSTALASI GAWAT DARURAT','diklat/brosur/WhatsApp_Image_2024-10-30_at_08.54.37.jpeg','usulan',198,8,181,'2024-10-30 00:55:45.468223','','2024-10-30 00:55:45.468266','','',0,1,1750000),(23,'UNTUK MEMENUHI STANDAR PELAYANAN MINIMAL DI IGD','diklat/brosur/WhatsApp_Image_2024-10-30_at_08.54.37_CE1f7m1.jpeg','usulan',199,8,177,'2024-10-30 01:00:14.867570','','2024-10-30 01:00:14.867611','','',0,1,1750000),(24,'Meningkatkan pengembangan diri','diklat/brosur/WhatsApp_Image_2024-11-02_at_12.27.11.jpeg','usulan',200,8,202,'2024-11-02 04:27:59.076920','','2024-11-02 04:27:59.076959','','',0,1,1500000),(25,'Untuk memenuhi standar pelayanan minimal di IGD','diklat/brosur/IMG-20240920-WA0010.jpg','usulan',201,8,190,'2024-11-07 06:23:24.672862','','2024-11-07 06:23:24.672903','','',0,1,1.600123),(26,'Genset','','usulan',204,8,329,'2024-11-13 05:14:04.838303','','2024-11-13 05:14:04.838345','','',0,5,13.17),(27,'Rumah Sakit Mandalika prov.NTB','diklat/brosur/KARYADI20241113_09160244.pdf','usulan',205,8,329,'2024-11-15 01:13:30.488144','diklat/tor/KARYADI20241113_09160244.pdf','2024-11-15 01:13:30.488205','','',0,5,6500000),(28,'Untuk meningkatkan pelayanan kritis dan emergency di Rumah Sakit Mandalika','diklat/brosur/WhatsApp_Image_2024-12-03_at_08.23.46.jpeg','usulan',206,8,169,'2024-12-03 00:24:03.883086','','2024-12-03 00:24:03.883128','','',0